import React, { Component } from 'react';
import { render } from 'react-dom';
import ContentBottom from './ContentBottom';
import './Overlay.css';

class Overlay extends Component {
    render() {
        return (
        <>
            <ContentBottom/>
        </>
        );
    }
}

export default Overlay;
